import React from 'react';
import './css/App.css';
import Header from './components/Header';
import Post from './components/Post';

const App=()=>{

    return(<div>
        <Header />
        <Post username="Rajat" caption="First post" imageUrl="https://www.clipartkey.com/mpngs/m/118-1188761_avatar-cartoon-profile-picture-png.png"/>
        <Post />
        <Post />
        <Post />
       

    </div>);
}

export default App;
